deck_description:
A consistent Dragun decklist with rainbow neos tech.

&nbsp;

Nothing else to say about this deck, really.

Mound of the Bound Creator protects all of your LVL 10 monsters from card effects.

&nbsp;

Aside from RA cards, what is the easiest and most powerful LVL 10 available? Rainbow Neos.

&nbsp;

Terraforming/metaverse to search Mound (or mystic mine if you want to tech it in- stalling is in your deck's favour as Rainbow Neos generates huge card advantage).

Field barrier protects Mound.

&nbsp;

<hr />

&nbsp;

I will draw attention to the fact that i've used Jet Synchron / combo draw package, because it is more powerful than the alternatives/lets you draw 4 cards/produce Borreload for negates. This deck likes card advantage to set up Ra OTK's.

If you want to replace Jet Synchron, use Ra's acolyte and Keeper of Dragon Magic (to search Neo Fusion)

Side Ghost Sister &amp; Spooky Dogwood for HP if you're struggling- you'll have hand advantage to pull it off + big RA attacks.

<hr />

Also Eygptian God slime + Mound + Field Barrier = Indestructable to both battle and card effects with protection on the field spell

&nbsp;

Phantom of chaos becomes very strong with Ra Sphere mode in the graveyard, as well as Rainbow Neos (allows phantom of chaos to return all enemy spells or monsters to deck). To ensure this effect goes off i'd run lightning storm (to bait negates) and card destruction to accelerate GY discards (jet synchron + barricade blocker also discard).

&nbsp;

You could possibly substitute Evilswarm for something else since you don't really want to wipe off all of your Xyz off the board.

&nbsp;

1.) Chain for Bahamut Shark to activate it's effect and either special summon Number 71 to chain for Blackray Lancer or special summon Toadally.

2.) Keep Xyz summoning until you have 3 or 4 and link summon Infinitrack. Activate Infinitrack's effect and special summon 1 xyz from the GY once per turn. Infinitrack is also a really great beat stick.

&nbsp;

Note: If you want lots of Xyz monsters on the field special summon Xyz Remora. ;)
